import { ReactChildren } from "react";

type buttonDefaultProps = {
    children?: ReactChildren,
    className?: string,
}
export function ButtonDefault(props: buttonDefaultProps) {
    return (
        <button className={'btn btn-default' + (props.className || '')} {...props}>
            {props.children || ' - '}
        </button>
    );
}
